import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { color } from '@mui/system';

function LoginPage() {
  const handleLogin = () => {
    // Add your login logic here
    console.log('Login button clicked');
  };

  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh', // Set to full viewport height
    }}>
      <div style={{ padding: '20px', width: '400px', textAlign: 'center' }}>
        <h1>Admin Panel</h1>
        <TextField
          id="filled-username"
          label="Username"
          variant="filled"
          margin="normal"
          fullWidth
          size="large" // Set to large size
        />
        <TextField
          id="filled-password"
          label="Password"
          type="password"
          variant="filled"
          margin="normal"
          fullWidth
          size="large" // Set to large size
        />
        <Button
          variant="contained"
          onClick={handleLogin}
          color="primary"
          style={{ marginTop: '20px', backgroundColor: 'green'}}
          fullWidth
          size="large" // Set to large size
        >
          Login
        </Button>
      </div>
    </div>
  );
}

export default LoginPage;
